// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import '../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol';


//proxy stuff from Dhruvin's opensea github added before deployment for first time
contract OwnableDelegateProxy { }

contract ProxyRegistry {
    mapping(address => OwnableDelegateProxy) public proxies;
}

abstract contract SeedBazaar is ERC721 {

    address bazaarOwner;
    address proxyRegistryAddress;

    //constructor
    constructor(address _proxyRegistryAddress) public {
        bazaarOwner = msg.sender;
        proxyRegistryAddress = _proxyRegistryAddress;
    }

    modifier _ownerOnly(){
            require(msg.sender == bazaarOwner, "Only the bazaar owner can conduct this action");
            _;
        }

   //struct for seeds
   struct Seed{
       string name;
       string description;
       uint quantity;
   }
   
   Seed[] public seeds;

    //mint function to register seed to a specific address
    function registerSeed(address to, string memory _name, string memory _description, uint _quantity) internal _ownerOnly {
        require(to != address(0), "No recipient address specified");
        uint id = seeds.length;
        seeds.push(Seed(_name, _description, _quantity));
        _mint(to, id);
    }
    //sell seed 
    function sellSeed(address receiver, uint id) public _ownerOnly returns (bool) {
        _transfer(msg.sender, receiver, id);
        return true;
    }   

    //allow a vendor to sell a specific seed
    function registerVendorForSeed(address vendor, uint id) internal _ownerOnly {
        approve(vendor, id);
    }

    //added this from Dhruvin's github with override keyword for first time deployment
    function isApprovedForAll(address owner, address operator) public view override returns (bool) {
    // Whitelist OpenSea proxy contract for easy trading.
        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        if (address(proxyRegistry.proxies(owner)) == operator) {
            return true;
        }
        return super.isApprovedForAll(owner, operator);
    }

    //check how many seeds are at an accout
    function seedBalance(address account) public view returns (uint) {
        return balanceOf(account);
    }

    //check who owns a certain seed
    function seedOwner(uint id) public view returns (address) {
        ownerOf(id);
    }
}
